import  React from "react";

import Compass from "./compass"
import Wind from "./wind"


const server_root = "http://localhost:3000"

class Instruments extends React.Component {
    constructor (props) {
        super(props);

        this.state = {
            data: null
        }
    }

    componentDidMount () {
        fetch(server_root + "/signalk/v1/api/")
            .then(response => response.json())
            .then (data => this.sestState({data}))
    }


    render () {
        return (        
            <div>
                <div className="table">
                    <Wind width={250} height={250} />
                    <Compass width={250} height={250} heading={0} />
                </div>
                <div className="table">
                    <Wind width={500} height={500} />
                </div>
            </div>
        );
    }
}

export default Instruments
